//経路表示
void print_route(int start,int goal,int pre[]){
    print_route_sub(pre[goal],start,pre);
    printf("%d\n",goal);
}
//経路表示補助
void print_route_sub(int id,int start,int pre[]){
    if(id!=start)print_route_sub(pre[id],start,pre);
    printf("%d ",id);
}
